	&__title {
		color: var(--gray-color);
		font-size: 12px;
		text-align: center;
		position: absolute;
		bottom: 10px;
		left: 50%;
		transform: translateX(-50%);
	}

	&__message {
		display: none;
		padding: 0 20px;
		width: 100%;

		&-header {
			display: flex;
			justify-content: space-between;
			align-items: center;
			height: 54px;
			border-bottom: 1px solid #eaeaea;
		}

		&-avatar {
			display: flex;
			align-items: center;
		}

		&-img {
			@include avatar;

			height: 34px;
			width: 34px;

