				align-items: center;
				height: 42px;
				padding: 10px 15px;
				font-size: 12px;

				&:hover {
					background-color: #e4edfd;
					border-radius: 12px;
				}

				&:first-child {
					padding-top: 15px;
				}

				img {
					display: inline-block;
					width: 22px;
					height: 22px;
				}

				&:last-child {
