							transform: rotate(0);
						}
					}
				}
			}
		}

		&-points {
			display: flex;
			flex-direction: column;
			justify-content: space-between;
			align-items: center;
			padding: 5px 10px;
			width: 25px;
			height: 25px;
			border-radius: 100%;
			background: #f5f5f5;
			position: relative;
			cursor: pointer;

