				display: inline-block;
				width: 3px;
				height: 3px;
				background-color: var(--main-color);
				border-radius: 100%;
			}

			&:hover .chats__message-menu {
				display: block;
			}
		}

		&-content {
			height: 610px;
			padding-bottom: 30px;
		}

		&-date {
			color: var(--name-color);
			text-align: center;
			font-size: 12px;
		}

		&-section {
			display: flex;
			justify-content: space-between;
			height: calc(100% - 19px);
		}

		&-friend {
			max-width: 402px;
			align-items: flex-end;
			justify-content: end;
		}

		&-text {
			max-width: 402px;
			min-width: 70px;
			font-size: 12px;

			&_friend {
				border-radius: 0 12px 12px;
				background-color: #e4edfd;
				padding: 11px;
			}

			&_your {
				border-radius: 12px 12px 0;
				background-color: #e4edfd;
				padding: 11px;
			}
		}

		&-wrapper {
			position: relative;
			margin-top: 10px;

			span {
				display: inline-block;
				position: absolute;
				right: 8px;
				bottom: 2px;
				font-size: 9px;
				color: var(--gray-color);
			}
		}

		&-picture {
			border: 1px solid var(--main-color);
			border-radius: 12px;
			width: 316px;
			height: 211px;

			img {
				border-radius: 12px;
				width: 100%;
				height: 100%;
			}
		}

		&-your {
			width: 402px;
			display: flex;
			align-items: flex-end;
			justify-content: end;
		}

		&-icons {
			position: absolute;
			bottom: 6px;
			right: 2px;
		}

		&-icon1 {
			display: none;
		}

		&-footer {
			display: flex;
			justify-content: space-between;
			align-items: center;
			height: 54px;
			border-top: 1px solid #eaeaea;
		}

		&-paperclip {
			width: 32px;
			height: 32px;
			position: relative;
			cursor: pointer;

			&:hover .chats__message-menu {
				display: block;
			}
		}

		&-form {
			display: flex;
			justify-content: space-between;
			align-items: center;
		}

		&-input {
			width: 849px;
			height: 32px;

			input {
				width: 100%;
				height: 100%;
				background: #efefef;
				border: 1px solid var(--main-color);
				border-radius: 30px;
				padding: 10px 20px;
				outline: none;
			}
		}

		&-send {
			width: 28px;
			height: 28px;
			border: 1px solid var(--main-color);
			background-color: var(--main-color);
			border-radius: 100%;
			display: flex;
			justify-content: center;
			align-items: center;
			margin-left: 3px;
			cursor: pointer;

			img {
				width: 15px;
				height: 15px;
				transform: translateX(2px);
			}
		}
	}
}

